import React from 'react';

function Resume() {
  return (
      <div id="resume" style={{ textAlign: 'center', margin: '20px 0' }}>
        <h2>My Resume</h2>
        <p>Click the button below to download my resume:</p>
        <a
    href="/Shuda_Yang resume.pdf"
    download
    style={{
      display: 'inline-block',
      padding: '10px 20px',
      fontSize: '16px',
      color: '#fff',
      backgroundColor: '#007bff',
      textDecoration: 'none',
      borderRadius: '5px',
    }}
  >
    Download My Resume
  </a>
</div>
  );
}

export default Resume;
